INSERT INTO blog VALUES('2', '1', 'Lỗi like nhưng báo là không like ?', 'Hiện tại rất nhiều anh em gặp phải lỗi này nên mình sẽ viết hướng dẫn để mọi người có thẻ thao tác được.\r\n\r\nĐầu tiên hãy thoát tài khoản và đăng nhập lại để khắc phục!!\r\n\r\nCó một số trường hợp sau đây dẫn tới vấn đề like không được hoặc đã like nhưng không nhận được xu:\r\n\r\n1. Trong quá trình trao đổi like fanpage bạn không được truy cập vào fanpage bằng tên tài khoản fanpage của bạn.\r\n\"Chuyển fb về chế độ tên tài khoản cá nhân hoặc đơn giản thoát nick fb ra rồi vào lại.\"\r\n\r\n2. Do trình duyệt đang lưu cache cũ nên app xác định sai dẫn đến lỗi ( biểu hiện là đa phần like đều không nhận được xu)\r\n\"Xóa cache trình duyệt\"\r\n\r\n3. Do page bị lỗi (người chủ page đã đặt thiết lập giới hạn trên trang page của họ sau khi họ đã thêm page vào hệ thống\r\n\r\n\"Báo lỗi bằng dấu chấm than ở page để BQT để kịp thời sử lý\"\r\n\r\n4. Bạn không nên trao đổi like một cách quá nhanh, quá nhiều trong cùng một thời điểm, với cùng một chức năng.\r\n\r\n5. Bạn phải chờ cửa sổ fb load xong trang rồi mới nhấn like.\r\n\"Trường hợp này thường xẩy ra khi đường truyền của bạn kết nối chậm, làm cho fb không kịp trả kết quả về hệ thống.\r\n\r\nCám ơn các bạn!', '1372034670');
INSERT INTO blog VALUES('4', '1', 'Quy định về nạp và Rút tiền', '<b>Quy định rút tiền</b>\r\n\r\nHIện tại, hình thức rút tiền bị đóng.\r\n\r\n<b>Quy Định Nạp tiền</b>\r\nHình thức nạp: Trực tiếp  ( liện hệ với hệ thống hỗ trợ trực tuyến)\r\nVì tạo điều kiện cho bạn nào không có thời gian like, chúng tôi sẽ cũng cấp dịch vụ nạp trực tuyến bằng các loại thẻ điện thoại Viettel, Mobiphone, Vina. Mệnh giá là 1$ = 20.000 VND . <b>Khi cần nạp hãy liên hệ trực tiếp với chúng tôi để nhanh chóng cập nhập cho các bạn không cần phải qua nhiều phương thức thanh toán rắc rối.</b>\r\n\r\n<b>Lý do nạp và rút tiền trực tuyến: An toàn, không bị thất thoát và có hiệu lực ngay lập tức. Nên các bạn hoàn toàn yên tâm.</b>\r\n\r\nCám ơn các bạn!', '1372120769');
INSERT INTO blog VALUES('5', '1', 'Quy định của ttovn.com', '<b>1. Thành viên sử dụng </b>\r\nBằng cách đăng ký hoặc sử dụng trang web này, bạn đã đồng ý đầy đủ các điều khoản và điều kiện của chúng tôi.\r\n\r\nXin hãy thông báo với chúng tôi về bất kỳ trang website nào xúc phạm, độc hại, hoặc không tuân theo điều khoản dịch vụ.\r\n\r\nChúng tôi có những phần thưởng dành cho những thành viên tốt trên website này, và không có sự khoan dung nào dành cho những người xấu!\r\n\r\nChúng tôi không chiệu trách nhiệm đối với các nội dung website được đăng tài trên hệ thống vì vậy việc đảm bảo máy tính của bạn được bảo vệ khỏi virus, trojan và phần mềm độc hại chính là ý thức và trách nhiệm của riêng bạn, không truy cập và những trang web chưa rõ nguồn gốc.\r\n\r\n\r\n<b>2. Sự lạm dụng và gian lận</b>\r\n\r\nBạn không được đăng ký hoặc đăng nhập nhiều tài khoản trên cùng một ip hoặc tại các máy chủ Proxy, nếu chúng tôi phát hiện các tên đăng nhập trên sẽ bị khóa.\r\n\r\nVới những link trang web được đăng tải có ngôn từ hàm ý xấu, nội dung khiêu gợi hoặc gian lận sẽ khiến trang web bị khóa vĩnh viễn, tất cả tiền mặt và tiền xu sẽ bị trừ đi bằng 0(không)\r\n\r\nKhông sử dụng Bot hoặc Marco, bạn sẽ bị cấm IP đăng nhập.\r\n\r\nThành viên nào không thực hiện trao đổi trong quá 30 ngày sau khi đăng ký, hoặc không đăng nhập trong một khoảng thời gian quá 60 ngày, tài khoản sẽ có nguy cơ bị xóa, tiền mặt hoa hồng hoặc tiền xu được nhận khi đăng ký sẽ bị trừ bằng 0.\r\n\r\nVới sự thận trọng của chúng tôi - trang web này dựa vào sự trao đổi tương tác cộng đồng và các thành viên giúp đỡ nhau.\r\n\r\n<b>3. Thanh toán </b>\r\n\r\nHiện tại vì mục đích thành lập là miễn phí, nên chỉ có mục đổi Vcoins ra tiền $ và không có rút tiền.\r\n\r\n\r\n<b>4. Page và Sites</b>\r\n\r\nKhông khiêu dâm, người lớn, hoặc có những liên kết nội dung tương tự (bao gồm cả tiêu đề của trang khiêu gợi / tình dục)\r\nKhông sòng bạc và cờ bạc (một số các trang web lô tô và xổ số kiến ​​thiết thành lập hợp pháp)\r\n\r\nNghiêm cấm trang bán hàng lừa đảo, hacking, cracking, warez, phân biệt chủng tộc, phản động, chính trị, vũ khí, hoặc bất cứ điều gì thường gây khó chịu hoặc có khả năng mang lại tiếng xấu cho trang web này.\r\n\r\nKhông đăng tải link đổi hướng tới các trang web khác hoặc các trang tải gây hiểu nhầm.\r\n\r\nCác link quảng cáo URL rút ngắn như ad.fly không được phép.\r\nCác trang website có chứa Hijack scripts, frame-breakers, page rotators, pop-ups, pop-unders không được phép hoạt đông tại website này.\r\nKhông được phép đăng tải các link của mạng xã hội Facebook, Google, Twitter, LinkedIn, Stumbleupon, Youtube trên sàn giao dịch trao đổi Traffic Exchange...\r\nCác trang bán Facebook Likes hoặc Followers Twitter và tương tự như likemienphi.com sẽ không được phép hoạt động.\r\nXin vui lòng không thêm trang Facebook hoặc Twitter mà không có một hình ảnh cá nhân hoặc nội dung.\r\n\r\nChúng tôi sẽ vô hiệu hóa các liên kết trang có vấn đề tải chậm, trang bị treo, hoặc trang có nội dung đã được đình chỉ do chủ sở hữu trang.\r\nTrong hầu hết các trường hợp trên chúng tôi sẽ gửi tin nhắn cho bạn với những lý do cho bất kỳ lệnh cấm trang bằng một thông báo cảnh báo, tuy nhiên vì bản chất năng động của hoạt động tự động lướt sóng trên sàn giao dịch trao đổi Traffic Exchange (auto surf) bất kỳ trang nào vi phạm các điều khoản hoặc gây ra tình trạng bị treo trong quá trình trao đổi sẽ bị xóa ngay lập tức mà không cần thông báo trước.\r\n\r\n\r\n<b>5. Về chúng tôi</b>\r\n\r\nChúng tôi có quyền thay đổi các điều khoản của chúng tôi tại bất kỳ thời điểm nào cho phù hợp với thực tế của website\r\nChúng tôi bảo lưu quyền thay đổi tỷ lệ hoa hồng của chúng tôi bất cứ lúc nào cho phù hợp với thực tế của website ', '1372141054');
