INSERT INTO blog VALUES('7', '1', 'Chào mừng tân chủ của ttovn.com, tặng ngay 20 mã coupon cho các thành viên', 'Kể từ ngày 18/7 ttovn.com chính thức xác nhập với ttovn.com\r\nCác thành viên đều có thể đăng nhập tại 2 địa chỉ website trên để kiếm like và coins.\r\nKỷ niệm lễ xác nhập này, Tân Chủ của ttovn.com tặng 20 mã cho 20 thành viên nhanh tay nhât, chi tiết:\r\n\r\n- Mã Phiếu Quà Tặng (coupon) trị giá 100 Coins, áp dụng cho 10 thành viên: 9509-7097-9925-1255\r\n- Mã Phiếu Quà Tặng (coupon) trị giá 50 Coins, áp dụng cho 10 thành viên: 1040-4825-8015-4757\r\nNào, hãy nhanh tay rung ngay phần thưởng về acc của mình.\r\n\r\nTrân trọng thông báo!', '1374294973');
INSERT INTO blog VALUES('8', '1', 'Quy định về rút tiền từ tài khoản', 'Like miễn phí cảm ơn sự hợp tác của các bạn, sự hợp tác này chính là sự phát triển bền vững của chúng Tôi trong tương lai.\r\nĐể khuyến khích và tôn vinh những thành viên tích cực tham gia trên hệ thống, chúng Tôi sẽ trả phí cho những thành quả của các bạn, tuy nhiên các bạn cũng cần phải tuân thủ vô điều kiện những quy định của chúng Tôi, cụ thể:\r\n- Thành viên chỉ có thể rút tiền sau 30 ngày hoạt động kể từ ngày đăng ký.\r\n- Mỗi thành viên muốn rút được tiền thì phải add 1 page vào hệ thống và page này phải có tối thiểu 100 trao đổi (like hoăc follow hoặc Plus hoặc Sub ...)\r\n- Số tiền tối thiểu bạn có thể rút là >=3 $\r\n- Hình thức nhận tiền:\r\n+ Nhận tiền qua tài khoản Bảo Kim\r\n+ Nhận tiền bằng thẻ Viettel, Vinaphone, Mobilphone (với số tiền nhỏ hơn hoặc bằng 20$)\r\n+ Nhận tiền qua chuyển khoản ngân hàng (với số tiền lớn hơn 20$, phí chuyển khoản thành viên phải trả)\r\n- Thành viên nhận được tiền trong vòng 10 ngày kể từ khi chúng Tôi nhận được yêu cầu rút tiền.\r\n- Chúng Tôi sẽ xác nhận thông tin thành viên: số điện thoại,email, địa chỉ, chứng minh thư nhân dân.\r\n- Thông tin tài khoản trên Likemienphi.com phải trùng với thông tin thanh toán: Điện thoại, email\r\n- Mỗi thành viên chỉ được rút tiền 1 lần trong 1 tháng.\r\n- Thời gian gửi yêu cầu rút tiền từ ngày mùng 1 đến mùng 10 của tháng đó.\r\n[b]- Những thành viên nào rút tiền sai quy định thì toàn bộ số tiền rút sẽ bị mất và không được cộng ngược lại vào tài khoản của bạn.[/b]\r\n- Danh sách các thành viên nhận được tiền sẽ được đăng tải tại mục \\\\\\\"Thông Báo \\\\\\\" của hệ thống.\r\n[b]Mọi quy định của chúng Tôi nhằm tạo ra một sân chơi trong sạch công bằng cho tất cả các thành viên.[/b]\r\n[b]Xem danh sách được nhận thanh toán và bị từ chối thanh toán tại đây:[/b]\r\n[url=http://likemienphi.com/blog.php?bid=17][b]XEM NGAY[/b][/url]\r\n           \r\n                                                                                                     Trân trọng thông báo.\r\n                                                                                                                 CEO', '1374339255');
INSERT INTO blog VALUES('9', '1', 'Quy định chung', 'TTOVNN.COM cảm ơn các bạn đã tham gia xây dựng hệ thống của chúng Tôi.Chúng Tôi sẽ cố gắng hoàn thiện mình để phục vụ các bạn một cách hoàn hảo nhất.\r\n\"Phát triển bền vững\" đó là tiêu chí hàng đầu của chúng Tôi, do vậy chúng Tôi rất cần sự hợp tác của tất cả các bạn khi tham gia hệ thống .Những quy định của chúng Tôi sẽ góp phần xây dựng cho hệ thống hoạt động một cách minh bạch và công bằng.Mọi sai phạm sẽ bị xử lý nghiêm ngặt mà không cần thông báo trước. Danh sách xử phạt sẽ được đăng tải tại mục \"Thông báo \".\r\nQuy định chung:\r\nI. THÀNH VIÊN SỬ DỤNG WEBSITE\r\n\r\nXin vui lòng đọc kỹ trang này. Bằng cách đăng ký tài khoản sử dụng trang web này, bạn cần phải đồng ý đầy đủ các quy định của Chúng Tôi với những thông tin bên dưới.\r\n\r\n1. Chúng Tôi luôn hoan nghênh các thành viên năng nổ và những thành viên mới. Số người mà bạn mời tham gia càng nhiều thì mọi người được like càng nhanh...\r\n\r\n2. Xin hãy thông báo với chúng tôi về bất kỳ trang website nào xúc phạm, độc hại, hoặc không tuân theo quy dịnh dịch vụ của chúng tôi.\r\n\r\n3. Chúng Tôi luôn có những phần thưởng dành cho những thành viên năng nổ trên website này, và không có sự khoan dung nào dành cho những người xấu, với những hành vi gian lận, làm hại đến hệ thống website!\r\n\r\n4. Thành viên nạp xu hoặc nạp tiền mặt trực tiếp vào tài khoản qua Paypal, Bảo Kim, Ngân Lượng chỉ được phép sử dụng, chúng tôi không có chính sách hoàn trả. \r\n\r\n5. Chúng Tôi không chịu trách nhiệm đối với nội dung của các trang website đăng tải trên hệ thống và các trường hợp bị khóa nick hoặc bị khóa các trang fanpage trên các mạng xã hội.\r\n\r\nII. ĐIỀU KHOẢN CHO THÀNH VIÊN\r\n\r\n1. Bạn không được phép đăng ký hoặc đăng nhập nhiều tài khoản trên cùng một ip đường truyền\r\n\r\n2. Bạn không được sử dụng VPN, proxy hoặc công cụ khác để thay đổi IP\r\n\r\n3. Bạn không được nạp xu hoặc tiền mặt bằng cách dùng thẻ tín dụng hoặc tài khoản giả mạo\r\n\r\n4. Bạn không được mua bán xu hoặc tài khoản từ một nhóm bên ngoài\r\n\r\n5. Bạn không được sử dụng bots, imacros, click tự động, hoặc script từ bên ngoài trên trang web\r\n\r\n6. Bạn không được phép bỏ theo dõi, bỏ like, bỏ G+ của người khác\r\n\r\n7. Bạn không được đăng tải nội dung có chứa hàm ý khiêu khích, đe dọa, hoặc khiêu dâm, khuyến khích bạo lực, hoặc chứa nội sex ảnh khỏa thân\r\n\r\n8. Bạn không được tham gia bán hàng đa cấp bất hợp pháp, như sắp xếp kiểu kim tự tháp, trên hệ thống của chúng Tôi\r\n\r\n9. Bạn không được đăng tải các nội dung có chứa virus hoặc mã độc hại lên hệ thống website ttovn.com\r\n\r\n10. Bạn không được sử dụng ttovn.com để làm bất cứ việc gì bất hợp pháp, lừa đảo, gây hiểm họa hoặc phân biệt đối xử\r\n\r\n11. Bạn không được làm bất cứ việc gì có thể vô hiệu hóa, gây áp lực hoặc làm suy yếu hoạt động phù hợp của Chúng Tôi, như tấn công dịch vụ, DDoS, Botnet...\r\n\r\n12. Thành viên nào không thực hiện trao đổi trong 30 ngày sau khi đăng ký, hoặc không đăng nhập sử dụng trong một khoảng thời gian quá 60 ngày, tài khoản sẽ có nguy cơ bị xóa, tiền mặt hoa hồng hoặc tiền xu được nhận khi đăng ký sẽ bị trừ bằng 0. \r\n\r\n13. Với sự thận trọng của chúng tôi, trang web này dựa vào sự trao đổi tương tác trên các cộng đồng mạng xã hội qua việc các thành viên trao đổi giúp đỡ nhau. Vì vậy nếu các thành viên vi phạm vào các điều khoản trên sẽ bị khóa tài khoản hoặc block IP vĩnh viển.\r\n\r\n14.Mọi thông tin của thành viên phải chính xác: email, điện thoại... Nếu không chúng Tôi sẽ từ chối lệnh rút tiền của các bạn.\r\n\r\n15. Mỗi thành viên chỉ được đặt lệnh rút tiền 1 lần trong 1 tháng vào các ngày từ mùng 1 đến mùng 10 hàng tháng.Ngoài thời gian trên thì lệnh rút tiền của các bạn sẽ bị từ chối và mất đi số tiền tương ứng. \r\n\r\nIII. QUY ĐỊNH VỀ ADD LINK LÊN HỆ THỐNG:\r\n\r\n1. Bạn không được phép thêm các trang web như cá độ và cờ bạc, khiêu dâm, người lớn, hoặc có những liên kết nội dung tương tự (bao gồm cả tiêu đề của trang khiêu gợi / tình dục)\r\n\r\n2. Bạn không được phép đăng tải các trang bán hàng lừa đảo, hacking, cracking, warez, phân biệt chủng tộc, phản động, chính trị, vũ khí, hoặc bất cứ điều gì thường gây khó chịu hoặc có khả năng mang lại tiếng xấu đến Likemienphi.com.\r\n\r\n3. Bạn không được phép đăng tải các link rút gọn thay đổi chuyển hướng tới các trang web khác tương tự như: Adf.ly,... hoặc các trang tải gây hiểu nhầm.\r\n\r\n4. Bạn không được phép đăng tải các trang website có chứa hijack scripts, frame-breakers, page rotators, pop-ups, pop-unders không được phép hoạt động tại website này.\r\n\r\n5. Bạn không được phép đăng tải các link của mạng xã hội như Facebook, Google, Twitter, LinkedIn, Stumbleupon, Youtube trên hệ thống chức năng trao đổi truy cập \"Traffic Exchange\"\r\n\r\n6. Bạn không được phép thêm các trang web trao đổi mua bán likes, followers, subscribers hoặc tương tự như web likemienphi.com\r\n\r\n7. Xin vui lòng không thêm và sử dụng tài khoản trang Facebook, Google+, Twitter mà không có hình ảnh cá nhân hoặc nội dung.\r\n\r\n8. Chúng tôi sẽ vô hiệu hóa các liên kết trang có vấn đề tải chậm, trang bị treo, hoặc trang có nội dung đã được đình chỉ do chủ sở hữu trang.\r\n\r\n9. Trong hầu hết các trường hợp trên chúng tôi sẽ không gửi tin nhắn cho bạn với những lý do cho bất kỳ lệnh cấm hoặc xóa link trang web. Vì bản chất năng động của hoạt động tự động lướt sóng trên sàn trao đổi Traffic Exchange (auto surf) bất kỳ trang nào vi phạm các điều khoản hoặc gây ra tình trạng bị treo trong quá trình trao đổi sẽ bị xóa ngay lập tức mà không cần thông báo trước.\r\n\r\nIV. QUY ĐỊNH VỀ BẢN QUYỀN\r\n\r\n1. Bằng cách sử dụng dịch vụ của chúng tôi, bạn chấp nhận hoàn toàn trách nhiệm đối với bất kỳ hành vi xâm phạm bản quyền tác giả hoặc quyền sở hữu trí tuệ của bất kỳ nội dung âm thanh(mp3), videp clip, hình ảnh hoặc bài viết chứa trong các trang web mà bạn đã thêm và hệ thống, chúng tôi sẽ tiến hành kiểm tra nếu như có một bên thứ ba yêu cầu khiếu nại. \r\n\r\n2. Chúng tôi sẽ loại bỏ bất kỳ trang web, banner hoặc liên kết mà chúng tôi tin rằng thúc đẩy vi phạm bản quyền hoặc phần mềm sao chép bất hợp pháp, âm thanh hoặc video, hack hay virus, phần mềm độc quyền.\r\n\r\nV. TỔNG KẾT:\r\n\r\nChúng tôi có quyền thay đổi các điều khoản quy định của chúng tôi tại bất kỳ thời điểm.\r\nNghiêm cấm sao chép các tính năng được phát triển bởi ttovn.com dưới mọi hình thức.\r\n\r\nMọi thành viên vi phạm những quy định trên sẽ không được rút tiền, bị khóa acc vĩnh viễn.\r\n\r\nTrân trọng thông báo.\r\n      CEO', '1374341036');
INSERT INTO blog VALUES('10', '1', 'Nhanh tay đăng ký nhận ngay tài khoản khủng', 'chương trình khuyến mãi của likemienphi.com và 123like.2tech.com.vn\r\n\"Nhanh tay đăng ký nhận ngay tài khoản khủng\"\r\nChương trình áp dụng đến hết tháng 11 năm 2013, cụ thể:\r\n- Tặng ngay 1000 Coins vào tài khoản cho thành viên thứ 2000\r\n- Tặng ngay 3000 Coins vào tài khoản cho thành viên thứ 5000\r\n- Tặng ngay 7000 Coins vào tài khoản cho thành viên thứ 10000\r\n\r\nNgoài ra mỗi tháng chúng Tôi sẽ thưởng Coins cho thành viên nào có tổng số Click  nhiều nhất , nhì, ba của tháng:\r\n- Thành viên có tổng số click nhiều nhất được tặng: 500Coins\r\n- Thành viên có tổng số click nhiều hai được tặng: 300Coins\r\n- Thành viên có tổng số click nhiều ba được tặng: 150Coins\r\n\r\nĐể xác định thành viên thứ 2000, 5000,10000 chúng tôi sẽ dựa vào số ID của acc khi đăng ký, danh sách thành viên may mắn trúng thưởng sẽ được thông báo trên mục \"Thông báo\" của hệ thống.\r\n', '1374418175');
INSERT INTO blog VALUES('12', '1', 'Danh sách thành viên nhận Khuyến mãi', 'Xin chúc mừng các thành viên sau đã nhận đươc Coins từ chương trình khuyến mãi của chúng  Tôi, số Coins đã được cộng trực tiếp vào tài khoản của các bạn: \r\n\r\n1. teddythy\r\n2. davidkhang1998\r\n3. tin47\r\n4. leosailor\r\nDanh sách tiếp tục được cập nhật...\r\n\r\nLưu ý: thành viên nào nạp tiền mà không nhận được Coins Khuyến mại thì hãy comment tại bài này nhé để mình kiểm tra.\r\nHoặc thành viên nào nạp thành công mà ko được cộng $ thì comment để bên mình xử lý.', '1374575959');
INSERT INTO blog VALUES('13', '1', 'Hướng dẫn cách kiếm tiền trên likemienphi.net', 'Chào các bạn.\r\nHôm nay Admin của likemienphi.net xin hướng dẫn chi tiết cách kiếm tiền trên hệ thống [url=http://likemienphi.net] tăng like facebook [/url]likemienphi.net.\r\nQuy trình kiếm tiền bao gồm các bước:\r\n\r\nKiếm thật nhiều Vcoins ---> Đổi Vcoins sang tiền $ --->Đặt lệnh rút tiền ---> nhận tiền về tài khoản hoặc bằng thẻ Card điện thoại.\r\n\r\nBƯỚC 1: KIẾM THẬT NHIỀU VCOINS:\r\n\r\n để kiếm được nhiều Vcoins bạn có thể làm theo nhiều phương pháp, cụ thể:\r\n- Vào mục \"KIẾM VCOINS\":\r\n\r\nTại mục này bạn có thể kiếm Vcoins bằng nhiều cách khác nhau, như:  like fanpage,like ảnh, follow... của những thành viên khác để nhận được số Vcoins tương ứng mà những thành viên đó đã đặt.\r\n\r\n- Hoặc bạn giới thiệu bạn bè cũng tham gia hệ thống likemienphi.net:\r\n\r\nphần thưởng bạn sẽ nhân được: 250 Vcoins  + 0.01$ vào tài khoản cho mỗi lần giới thiệu thành công. Hơn nữa mỗi lần người mà bạn giới thiệu nạp tiền thì bạn sẽ nhận được 10% số tiền nạp đó\r\n\r\nNhưng làm sao để hệ thống biết bạn đã giới thiệu được những ai?\r\nĐơn giản, chỉ bạn dùng 1 link Ref do hệ thống cấp cho bạn, bạn dùng link đó đi giới thiệu, khi một người đăng ký thành viên qua link Ref của bạn thì hệ thống sẽ ghi nhận và tư động cộng tiền thưởng cho bạn.\r\nBạn có thể xem tại mục:  http://likemienphi.net/refer.php\r\n\r\nVí dụ link Ref: http://likemienphi.net/?ref=1\r\nMỗi thành viên khi đăng ký thành công sẽ đều có 1 link Ref.\r\nHoặc bạn có thể đặt banner của Likemienphi.com nên website của bạn.Khi có ai đó click vào banner và đăng ký tài khoản TTOVN.COM  thì bạn cũng nhận được số tiền như trên:\r\nví dụ về ads banner:\r\n\r\n<a href=\"http://likemienphi.net/?ref=1\" target=\"_blank\"><img src=\"http://ttovn.com/img/banner.png\" alt=\"tăng like Facebook, tang like facebook, tăng like, tang like, like facebook, tăng like face, tang like face\" border=\"0\" /></a>\r\n\r\nBƯỚC 2: ĐỔI VCOINS SANG TIỀN $;\r\nTrước tiên bạn hãy vào mục:\r\n\r\nhttp://likemienphi.net/bank.php?withdraw\r\n\r\nsau đó chon Tab đổi Vcoins sang tiền\r\nTỷ giá đổi:\r\n2500Vcoins=1$\r\n\r\nnhững lần giao dịch đổi tiền của bạn sẽ được hệ thống ghi nhận\r\n\r\nBƯỚC 3: RÚT TIỀN:\r\n Sau khi đã tích lũy được tối thiểu 3$ bạn đã có thể đặt lệnh rút tiền:\r\nBạn hãy vào mục Rút Tiền:\r\nhttp://likemienphi.net/bank.php?withdraw\r\n\r\nSau đó chọn Tab \"Rút tiền\"\r\n\r\nTại đây bạn có thể chọn được nhiều hình thức rút tiền: Qua bảo kim, chuyển khoản ngân hàng hay thẻ card điện thoại.\r\n\r\nSau khi nhận được lệnh rút tiền của các bạn, chúng Tôi sẽ xác nhận qua Email và số điện thoại. Sau khi xác nhận chính xác thì các bạn sẽ nhận được tiền của mình. Thời gian khoảng 7 ngày.\r\n\r\nLưu ý:\r\n- Lệnh rút tiền chỉ được diễn ra vào ngày mùng 1 đến ngày mùng 10 của tháng.Ngoài những ngày đó ra thì lệnh rút tiền của các bạn sẽ bị hủy(khi lệnh bị hủy thì tiền trong tài khoản của các bạn sẽ bị mất)\r\n- Mỗi tháng chỉ được rút một lần.\r\n- Nghiêm cấm mọi hình thức dùng phần mềm tự động, hack để kiễm Vcoins.Chúng Tôi sẽ Ban tài khoản mà không cần báo trước.\r\n\r\nChúc các bạn thành công\r\n', '1374942633');
INSERT INTO blog VALUES('18', '1', 'Event  ', 'Mời các bạn tham gia Event Thi tài cùng likemienphi.net\r\n- Thời gian: từ Chủ nhật ngày 18/8 đến hết chủ nhật ngày 25/8\r\n- Phần thưởng: 1000 Vcoins\r\n- Đối tượng tham gia: tất cả các thành viên của hệ thống likemienphi.net\r\n- Thể lệ: ai có đáp án hay nhất và đúng nhất sẽ được phần thưởng 1000 Vcoins\r\n\r\nNội dung:\r\nNội dung Event lần này là giải câu đố:\r\nCâu đố:\r\nCó 3 Chàng trai cùng đi nhậu, khi ra thanh toán hết tổng 250.000 đ, mỗi Chàng trai bỏ ra 100.000đ để trả cho chủ quán (Tổng của 3 người là 300.000đ)\r\nChủ quán trả lại 3 Anh số tiền là: 300.000-250.000=50.000đ (tiền thừa).\r\nVới 50.000đ tiền thừa này lại chia ra cho mỗi người nhận lại 10.000đ , như vậy mỗi người chỉ mất có 90.000đ và còn dư quỹ 20.000đ.\r\nỒ, kỳ lạ.....\r\n(90.000/1 người x3 ) + 20.000=290.000 đ\r\nVậy 10.000đ đã biến đi đâu mất rồi.\r\n ĐÁP ÁN:\r\nChào các thành viên thân mến.\r\nĐáp án cho câu đố lần này hết sức đơn giản, đáp án cho câu hỏi \\\"10.000đ đã biến đi đâu mất rồi\\\" là thực tế 10.000đ này không hề tồn tại nên nó không thể biến đi đâu được cả vì sau khi mỗi người được trả lại 10.000 đ tiền thừa, thì thực tế mỗi người chỉ mất 90.000đ, như vậy 90.000 x3=270.000đ.\r\nTiền trả cho chủ quán là 250.000đ do đó:\r\n270.000-250.000= 20.000 đ\r\n\r\nTỔNG KẾT:\r\nDựa theo Comment của các thành viên, ban quản trị chúng Tôi xét thấy bạn \\\"kienvang\\\" có câu trả lời đúng nhất và sớm nhất, nội dung trả lời:\r\n\\\"Mỗi người thực tế góp 90K. Tổng cộng quỹ là 270K. Trả tiền nhậu 250K. Quỹ còn dư 20K là đúng rồi.\r\nVấn đề là sự nhầm lẫn ở số tổng quỹ. 270K chứ không phải là 300K.\\\"\r\n\r\nXin chúc mừng bạn nhận được giải thưởng 1000Vcoins cho event lần này.', '1376757314');
