INSERT INTO blog_comments VALUES('85', '18', '579', 'đọc lại câu hỏi đi bạn: thangbuu\r\nmỗi Chàng trai bỏ ra 100.000đ để trả cho chủ quán (Tổng của 3 người là 300.000đ)', '1376803780');
