INSERT INTO faq VALUES('1', 'Hướng dẫn các bạn mới ! Hãy vào và tìm hiểu cách sử dụng.', '[b]Bước 1: thêm trang fanpage, facebook cá nhân vào. Chọn đúng thể loại bạn muốn tăng.[/b]\r\n\r\n1. [b]Facebook Likes[/b]: Dùng tăng like cho fanpage hoặc tăng like cho website của bạn\r\nURL: Fanpage có dạng như: http://www.facebook.com/hoanggiainc\r\nHoặc link website của bạn vd: http://www.hoanggia.net\r\n\r\n2. [b]Facebook Photo Likes[/b]: Dùng tăng like hình ảnh fanpage facebook.\r\nURL: tăng like hình ảnh trên fanpage có dạng như: http://www.facebook.com/photo.php?fbid=453963688024591\r\nTăng like hình ảnh phải thuộc fanpage của bạn\r\nLưu ý: tính năng này không áp dụng tăng like hình ảnh trên tài khoản cá nhân.\r\n\r\n3. [b]Facebook Share[/b]: Dùng chia sẽ các link thuộc trang web riêng của bạn\r\nURL: chia sẽ link có dạng như: http://www.hoanggia.net\r\nLưu ý: tính năng này không áp dụng các link chia sẽ hình ảnh, comments hoặc stt trên facebook\r\n\r\n4. [b]Facebook Followers[/b]: Chức năng tăng Followers (theo dõi) trên Facebook.\r\nĐối với chức năng này chỉ cần bạn nhập đường dẫn như sau: http://www.facebook.com/nguyen-van-a\r\nHệ thống sẽ tự động nhận dạng tài khoản của bạn trên facebook, yêu cầu bạn cần phải bật chức năng theo dõi trên tài khoản cá nhân của bạn và phải có ít nhất 1 theo dõi.\r\n\r\n\r\n<img src=\"http://www.likemienphi.net/hd1.jpg\" Width=\"630px\">\r\n\r\n\r\n\r\nXong bước 1 --->  hãy đến bước quan trong để có nhiều like\r\n\r\n[b]Bước 2: Kiếm vcoin để có nhiều like[/b]\r\n\r\n[u]Cách 1:[/u]\r\nChủ động đi like, follow, views trang fanpage, website của các thành viên khác để nhận về số Coins tương ứng mà các thành viên đã đặt (Giá CPC mà thành viên trả cho bạn)\r\n\r\n<img src=\"http://www.likemienphi.net/hd2.jpg\" Width=\"630px\">\r\n\r\n[u]Cách 2: [/u]Nạp Tiền vào tài khoản qua hệ thống thanh toán trực tuyến của chúng Tôi tại [b] \"$Nạp tiền$\" [/b]:\r\nCác bạn có thể nạp bằng card điện thoại mạng Viettel, Vina,Mobilfone, thẻ Gate game hoặc thanh toán bằng tài khoản Bảo Kim.\r\nTỷ giá quy đổi:\r\n1$= 21.000 vnđ\r\n\r\nNếu bạn nạp nhiều đề nghị chuyển khoản qua ngân hàng:\r\n\r\nTên tài khoản: Hoàng Văn Hữu\r\n\r\nngân hàng: VietcomBank - Chi nhánh Thành Công Hà Nội\r\n\r\nSố tài khoản: 0451001569018\r\n\r\n<img src=\"http://www.likemienphi.net/img/naptien.jpg\" Width=\"630px\">\r\n\r\nSau khi nạp tiền và hệ thống tự động quy đổi sang đôla.Các bạn tiến hành chuyển từ đôla ( $) sang tiền Coins để sử dụng:\r\nChọn chức năng \"Nạp Vcoins\" và chọn chức năng mua tương ứng\r\nTỷ giá quy đổi từ tiền $ sang tiền Coins:\r\n0.5$ = 450 Coins\r\n   1$ = 900 Coins\r\n   5$ = 4.500 Coins\r\n 10$ = 9.000 Coins\r\n 15$ = 13.500 coins\r\n\r\n<img src=\"http://www.likemienphi.net/img/napcoin.jpg\" Width=\"630px\">\r\n\r\n[b]Cấu hình CPC[/b]\r\nCPC là lượng Vcoin bạn dùng để trả cho thành viên khi họ like, share, follow và trang web của bạn. Bạn có thể tùy chọn số lượng Vcoin cho 1 lần click\r\n\r\nNếu có gì thắc mắc hãy liên lạc với chúng tôi, yahoo hay click vào hỗ trợ trực tuyến!');
